import { backendAPI } from '../../api';
export class EmulatorServiceImplementation {
  async getSettings() {
    const settings = await backendAPI.get('emulator/settings');
    return settings.data;
  }

  async updateSettings(changes) {
    const updatedSettings = await backendAPI.patch('emulator/settings', changes);
    return updatedSettings.data;
  }

  async getTexts() {
    const texts = await backendAPI.get('emulator/texts');
    return texts.data;
  }

  async updateTexts(changes) {
    const updatedTexts = await backendAPI.patch('emulator/texts', changes);
    return updatedTexts.data;
  }

}
